the janitor in charge. It worked in Good Will Hunting. No, wait... no, no it didn't. Don't do that!\\n\\nSubscribe if you enjoy!  http:\/\/bit.ly\/letsgameitout_show\\n\\nTwitter  https:\/\/twitter.com\/letsgameitout\\nFacebook  https:\/\/www.facebook.com\/letsgameitout\\n\\nWant to see more Let's Game It Out?\\n\\nMore Simulator Mayhem  https:\/\/www.youtube.com\/watch?v=UqaNKNgSxYI\\u0026list=PLrBjj4brdIRzn3ja4BfqYUForg0p-p5wi\\n\\nFunny Tycoon Games  https:\/\/www.youtube.com\/watch?v=UqaNKNgSxYI\\u0026list=PLrBjj4brdIRwf14QPGmfDXCQQrDs860ig\\n\\nThe Finest One-Offs  https:\/\/www.youtube.com\/watch?v=zIOFGCbwJSs\\u0026list=PLrBjj4brdIRwKf72d6spk7fSHhwwYuQu1\\n\\nSome Truly Bizarre Games   https:\/\/www.youtube.com\/watch?v=zIOFGCbwJSs\\u0026list=PLrBjj4brdIRyM5mUsHwPN0PH6UVNfeNl2\\n\\nI Made Millions on a Hospital with a 0% Cure Rate - Two Point Hospital\\n\\n#LetsGameItOut #Tycoon #Funny\\n\\n----------\\n\\nTwo Point Hospital on Steam  https:\/\/store.steampowered.com\/app\/535930\/Two_Point_Hospital\/\\n\\nAbout This Game\\n\\nDesign and build your own hospital!\\n\\nBuild up a hospital from nothing to a masterpiece as you design the most beautiful  or functional  healthcare operation in the whole of Two Point County.\\n\\nOptimize your hospital design to increase patient (and cash) flow, arranging corridors, rooms and waiting areas to your exact specifications. Expand your hospital to multiple buildings as you look to get as many patients through the door as possible.\\n\\nPlace decorative and functional items around your hospital to improve its prestige, lower patient boredom, increase happiness and keep those end of year awards flowing in.\\n\\nCure unusual illnesses\\n\\nDont expect Two Point County to be populated with your usual types of patients. In this world, youll experience all kinds of unusual illnesses; from Light-headedness to Cubism  each requiring their very own special type of treatment machine.\\n\\nDiagnose illnesses, build the right rooms to handle them, hire the right staff, and then get ready, because curing just one of these illnesses is just the beginning. You can handle a single patient  but can you handle a Pandemic?\\n\\nOnce youve conquered an illness, research improved cures and machines and turn your hospital into an unstoppable healthcare juggernaut.\\n\\nImprove and expand your hospital horizons!\\n\\nYour first hospital is where it begins, but what next?\\n\\nOnce youve cured the residents of a small harbor village, can you take on a bigger challenge in a busier hospital?\\n\\nImprove your facilities, upgrade machines, staff and layouts to make more money, more quickly.\\n\\nTrain and improve your staff, leveling them up with new skills and abilities to make your hospital even more efficient.\\n\\nMake use of the extensive statistic and information screens to analyse your strengths and weaknesses, and make rapid alterations. Adjust the price of your treatments, keep an eye on your turnover, take out loans and optimize your earnings.\\n\\nYoull be managing staff with unique personality types and traits, so youll need to keep an eye on whos being efficient  and who is just a pain in the neck. Balance your workforce with your ambitions as you strive to make profit (and hopefully save some people along the way).\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/4-u_I8o0VEk\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLC1a78OVyIAq_1pYTI4dHH76SF9lw\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/4-u_I8o0VEk\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDxrObjjxnN1pHFk0oyjFoLrriHpA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/4-u_I8o0VEk\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLAinBWXc44h_PaqmNbdSPRATgIErA\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\ uiring their very own special type of treatment machine.\\n\\nDiagnose illnesses, build the right rooms to handle them, hire the right staff, and then get ready, because curing just one of these illnesses is just the beginning. You can handle a single patient  but can you handle a Pandemic?\\n\\nOnce youve conquered an illness, research improved cures and machines and turn your hospital into an unstoppable healthcare juggernaut.\\n\\nImprove and expand your hospital horizons!\\n\\nYour first hospital is where it begins, but what next?\\n\\nOnce youve cured the residents of a small harbor village, can you take on a bigger challenge in a busier hospital?\\n\\nImprove your facilities, upgrade machines, staff and layouts to make more money, more quickly.\\n\\nTrain and improve your staff, leveling them up with new skills and abilities to make your hospital even more efficient.\\n\\nMake use of the extensive statistic and information screens to analyse your strengths and weaknesses, and make rapid alterations. Adjust the price of your treatments, keep an eye on your turnover, take out loans and optimize your earnings.\\n\\nYoull be managing staff with unique personality types and traits, so youll need to keep an eye on whos being efficient  and who is just a pain in the neck. Balance your workforce with your ambitions as you strive to make profit (and hopefully save some people along the way).\"},\"lengthSeconds\":\"746\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCto7D1L-MiRoOziCXK9uT5Q\",\"externalChannelId\":\"UCto7D1L-MiRoOziCXK9uT5Q\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",  you look to get as many patients through the door as possible.\n\nPlace decorative and functional items around your hospital to improve its prestige, lower patient boredom, increase happiness and keep those end of year awards flowing in.\n\nCure unusual illnesses\n\nDont expect Two Point County to be populated with your usual types of patients. In this world, youll experience all kinds of unusual illnesses; from Light-headedness to Cubism  each requiring their very own special type of treatment machine.\n\nDiagnose illnesses, build the right rooms to handle them, hire the right staff, and then get ready, because curing just one of these illnesses is just the beginning. You can handle a single patient  but can you handle a Pandemic?\n\nOnce youve conquered an illness, research improved cures and machines and turn your hospital into an unstoppable healthcare juggernaut.\n\nImprove and expand your hospital horizons!\n\nYour first hospital is where it begins, but what next?\n\nOnce youve cured the residents of a small harbor village, can you take on a bigger challenge in a busier hospital?\n\nImprove your facilities, upgrade machines, staff and layouts to make more money, more quickly.\n\nTrain and improve your staff, leveling them up with new skills and abilities to make your hospital even more efficient.\n\nMake use of the extensive statistic and information screens to analyse your strengths and weaknesses, and make rapid alterations. Adjust the price of your treatments, keep an eye on your turnover, take out loans and optimize your earnings.\n\nYoull be managing staff with unique personality types and traits, so youll need to keep an eye on whos being efficient  and who is just a pain in the neck. Balance your workforce with your ambitions as you strive to make profit (and hopefully save some people along the way)."}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"nav book  https://www.facebook.com/letsgameitout\n\nWant to see more Let's Game It Out?\n\nMore Simulator Mayhem  https://www.youtube.com/watch?v=UqaNKNgSxYI\u0026list=PLrBjj4brdIRzn3ja4BfqYUForg0p-p5wi\n\nFunny Tycoon Games  https://www.youtube.com/watch?v=UqaNKNgSxYI\u0026list=PLrBjj4brdIRwf14QPGmfDXCQQrDs860ig\n\nThe Finest One-Offs  https://www.youtube.com/watch?v=zIOFGCbwJSs\u0026list=PLrBjj4brdIRwKf72d6spk7fSHhwwYuQu1\n\nSome Truly Bizarre Games   https://www.youtube.com/watch?v=zIOFGCbwJSs\u0026list=PLrBjj4brdIRyM5mUsHwPN0PH6UVNfeNl2\n\nI Made Millions on a Hospital with a 0% Cure Rate - Two Point Hospital\n\n#LetsGameItOut #Tycoon #Funny\n\n----------\n\nTwo Point Hospital on Steam  https://store.steampowered.com/app/535930/Two_Point_Hospital/\n\nAbout This Game\n\nDesign and build your own hospital!\n\nBuild up a hospital from nothing to a masterpiece as you design the most beautiful  or functional  healthcare operation in the whole of Two Point County.\n\nOptimize your hospital design to increase patient (and cash) flow, arranging corridors, rooms and waiting areas to your exact specifications. Expand your hospital to multiple buildings as you look to get as many patients through the door as possible.\n\nPlace decorative and functional items around your hospital to improve its prestige, lower patient boredom, increase happiness and keep those end of year awards flowing in.\n\nCure unusual illnesses\n\nDont expect Two Point County to be populated with your usual types of patients. In this world, youll experience all kinds of unusual illnesses; from Light-headedness to Cubism  each requiring their very own special type of treatment machine.\n\nDiagnose illnesses, build the right rooms to handle them, hire the right staff, and then get ready, because curing just one of these illnesses is just the beginning. You can handle a single patient  but can you handle a Pandemic?\n\nOnce youve conquered an illness, research improved cures and machines and turn your hospital into an unstoppable healthcare juggernaut.\n\nImprove and expand your hospital horizons!\n\nYour first hospital is where it begins, but what next?\n\nOnce youve cured the residents of a small harbor village, can you take on a bigger challenge in a busier hospital?\n\nImprove your facilities, upgrade machines, staff and layouts to make more money, more quickly.\n\nTrain and improve your staff, leveling them up with new skills and abilities to make your hospital even more efficient.\n\nMake use of the extensive statistic and information screens to analyse your strengths and weaknesses, and make rapid alterations. Adjust the price of your treatments, keep an eye on your turnover, take out loans and optimize your earnings.\n\nYoull be managing staff with unique personality types and traits, so youll need to keep an eye on whos being efficient  and who is just a pain in the neck. Balance your workforce with your ambitions as you strive to make profit (and hopefully save some people along the way).","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/4-u_I8o0VEk/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLC1a78OVyIAq_1pYTI4dHH76SF9lw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/4-u_I8o0VEk/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDxrObjjxnN1pHFk0oyjFoLrriHpA","width":196,"height":110},{"url":"https://i.ytimg.com/vi/4-u_I8o0VEk/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAinBWXc44h_PaqmNbdSPRATgIErA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/4-u_I8o0VEk/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBCsgwgi1fvql1KqR_M_Pt2Jca1MA","width":336,"height":188},{"url":"https://i.ytimg.com/vi/4-u_I8o0VEk/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher":false,"averageRating":4.9376431,"allowRatings":true,"viewCount":"2610748","author":"Let' \n\nI Made Millions on a Hospital with a 0% Cure Rate - Two Point Hospital\n\n#LetsGameItOut #Tycoon #Funny\n\n----------\n\nTwo Point Hospital on Steam  https://store.steampowered.com/app/535930/Two_Point_Hospital/\n\nAbout This Game\n\nDesign and build your own hospital!\n\nBuild up a hospital from nothing to a masterpiece as you design the most beautiful  or functional  healthcare operation in the whole of Two Point County.\n\nOptimize your hospital design to increase patient (and cash) flow, arranging corridors, rooms and waiting areas to your exact specifications. Expand your hospital to multiple buildings as you look to get as many patients through the door as possible.\n\nPlace decorative and functional items around your hospital to improve its prestige, lower patient boredom, increase happiness and keep those end of year awards flowing in.\n\nCure unusual illnesses\n\nDont expect Two Point County to be populated with your usual types of patients. In this world, youll experience all kinds of unusual illnesses; from Light-headedness to Cubism  each requiring their very own special type of treatment machine.\n\nDiagnose illnesses, build the right rooms to handle them, hire the right staff, and then get ready, because curing just one of these illnesses is just the beginning. You can handle a single patient  but can you handle a Pandemic?\n\nOnce youve conquered an illness, research improved cures and machines and turn your hospital into an unstoppable healthcare juggernaut.\n\nImprove and expand your hospital horizons!\n\nYour first hospital is where it begins, but what next?\n\nOnce youve cured the residents of a small harbor village, can you take on a bigger challenge in a busier hospital?\n\nImprove your facilities, upgrade machines, staff and layouts to make more money, more quickly.\n\nTrain and improve your staff, leveling them up with new skills and abilities to make your hospital even more efficient.\n\nMake use of the extensive statistic and information screens to analyse your strengths and weaknesses, and make rapid alterations. Adjust the price of your treatments, keep an eye on your turnover, take out loans and optimize your earnings.\n\nYoull be managing staff with unique personality types and traits, so youll need to keep an eye on whos being efficient  and who is just a pain in the neck. Balance your workforce with your ambitions as you strive to make profit (and hopefully save some people along the way)."},"lengthSeconds":"746","ownerProfileUrl":"http://www.youtube.com/channel/UCto7D1L-MiRoOziCXK9uT5Q","externalChannelId":"UCto7D1L-MiRoOziCXK9uT5Q","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"2610748","category":"Gaming","publishDate"
